import React from 'react';

const Home = () => {
return (
	<div
	style={{
		display: 'flex',
		justifyContent: 'center',
		alignItems: 'center',
		height: '100vh'
	}}
	>
	<h1>Crud Operation using Asp.net core 3.1 and ReactJs 12</h1>
	</div>
);
};

export default Home;
